import React from "react";

const SumCell = ({ value, sumMouseEnterHandler, sumMouseLeaveHandler }) => {
   return (
      <rd
         className="sum-cell"
         onMouseEnter={sumMouseEnterHandler}
         onMouseLeave={sumMouseLeaveHandler}
      >
         {value}
      </rd>
   );
};

export default SumCell;
